import ExpenseItem from "./ExpenseItem"

const ExpenseList = (props) => {
    let expenseContent = <p>NO DATA FOUND</p>



    return (
        <ul className="expenses-list">
            {props.expenses.map((temp) => 
                <ExpenseItem
                key = {temp.id}
                title = {temp.title}
                amount = {temp.amount}
                date = {temp.date}
                />
            )}
        </ul>
    )

}

export default ExpenseList
